import React, { Component } from "react";

class ProfessonalForm extends Component {
  render() {
    return (
      <fieldset>
        <legend>Dados Profissionais</legend>
        <div>
          Resumo do curriculo
          <textarea name="resume" maxLength="1000" required/>
        </div>
      </fieldset>
    )
  }
}

export default ProfessonalForm;
